import { BoldAppText, MediumAppText } from '../styles/text'

function Footer () {

  const navigation = useNavigation();

  return (
    <View style={styles.container}>
      <View>
        <BoldAppText style={styles.text} onPress={() => navigation.navigate('Summary')}>Summary Link</BoldAppText>
      </View>
      <View>
        <BoldAppText style={styles.text} onPress={() => navigation.navigate('Calendar')}>Calendar Link</BoldAppText>
      </View>
      <View>
        <Text>Spare</Text>
      </View>
      <View>
      <Text>Spare</Text>
      </View>
    </View>
  );
}

